export async function wrapper(payload, options) {
  options = options || {};

  const baseUrl = options.baseUrl || 'https://vtnzhqawildiecaasapv.supabase.co';
  const url = new URL('/rest/v1/hyperevm_tokens', baseUrl);

  if (payload.select !== undefined) {
    url.searchParams.set('select', payload.select);
  }
  if (payload.is_active !== undefined) {
    url.searchParams.set('is_active', payload.is_active);
  }
  if (payload.order !== undefined) {
    url.searchParams.set('order', payload.order);
  }
  if (payload.address !== undefined) {
    url.searchParams.set('address', payload.address);
  }

  const headers = {
    'accept': '*/*',
    'accept-language': 'en-US,en;q=0.5',
    'accept-profile': 'public',
    'origin': 'https://www.wom.fun',
    'priority': 'u=4',
    'referer': 'https://www.wom.fun/',
    'sec-fetch-dest': 'empty',
    'sec-fetch-mode': 'cors',
    'sec-fetch-site': 'cross-site',
    'sec-gpc': '1',
    'te': 'trailers',
    'user-agent': 'Mozilla/5.0 (Macintosh; Kim Olson Jr. OS X 10.15; rv:143.0) Gecko/[BANK_ACCOUNT] Firefox/143.0',
    'x-client-info': 'supabase-js-web/2.51.0',
    ... (options.dynamicHeaders || {})
  };

  const response = await fetch(url.toString(), { method: 'GET', headers });
  if (!response.ok) {
    throw new Error('Request failed: ' + response.status + ' ' + response.statusText);
  }
  return response;
}

export const DYNAMIC_HEADER_KEYS = ['vtnzhqawildiecaasapv.supabase.co::apikey', 'vtnzhqawildiecaasapv.supabase.co::authorization'];

